import React from 'react';

function App() {
  return (
    <div>
      <nav>
        <ul>
          <li><a href="/">Home</a></li>
          <li><a href="/about">About</a></li>
          <li><a href="/contact">Contact</a></li>
        </ul>
      </nav>
      <h1>Welcome to my Website</h1>
      <p>Here is some text about my website.</p>
    </div>
  );
}

export default HomePage;
